import Subheading from "../Atoms/subheading";

function DetailPage() {
    return (
        <div>
            <div style={{ display: "flex" }}>
                <Navitage />
                <div className={styless.game_position}>
                    <PlayGame />
                    <GameDescription />

                    <Subheading contents={"댓글"}/>
                    <div className={styless.commentBox}>
                    <Comment />
                    <Comment />
                    <Comment />
                    <Comment />
                    <Comment />
                    </div>
                </div>
            </div>
        </div>
    )
}

